import Link from 'next/link';
import './styles.css'

const Index= () => {
  return (
    <div>
      <h1>Ol√° semana Fullstack</h1>
      <div>
        <Link href= './about'>
          <a>Sobre</a>
        </Link><br/>
        <Link href= './contact'>
          <a>Contato</a>
        </Link> <br/>
        <Link href= './search'>
          <a>Pesquisa</a>
        </Link>

      </div>
    </div>

  )
}

export default Index;
